import React from "react";
import "./signture.css";
import SIGNIN from "./signIn";
import SIGNUP from "./signUp";
const SIGNTURE = () => {
  return <>
  <section className="signture">
    {/* <div className="welcomeOverlay"></div> */}
    <div className="signtureContainer">
    <SIGNIN/>
    <SIGNUP />
    </div>

  </section>
  </>;
};
export default SIGNTURE;
